import React from "react";
import { Form } from "antd";

const FormItem = Form.Item;
function componentSuggestion() {
  return (
    <FormItem>
      <div
        style={{
          width: "398px",
          height: "222px",
          background: "white",
          borderRadius: "25px",
          padding: "20px",
          flexDirection: "column",
          textAlign:"center"
        }}
        className="nu-font-covid"
      >
        <div>
          <h1 style={{ color: "#EC6E00",fontSize:"35px" }}>คำแนะนำ</h1>
        </div>
        <div >
          <h1 style={{ color: "black",fontSize:"22px" }}>กรุณาฟังเสียงคำถามให้จบแล้วรอเสียง ติ๊ด เพื่อบอกว่าพร้อมบันทึกเสียง</h1>
        </div>
      </div>
      <div
        style={{
          width: "398px",
          height: "222px",
          background: "white",
          borderRadius: "25px",
          padding: "20px",
          flexDirection: "column",
          textAlign:"center"
        }}
        className="nu-font-covid"
      >
        <div>
          <h1 style={{ color: "#EC6E00",fontSize:"35px" }}>แจ้งเตือน</h1>
        </div>
        <div >
          <h1 style={{ color: "black",fontSize:"22px" }}>ไม่พบข้อมูลของคุณ กรุณาโชว์บัตรประจำตัวประชาชนที่หน้ากล้อง</h1>
        </div>
      </div>
    </FormItem>
  );
}

export default componentSuggestion;
